import React, {Component} from "react";
import {
    NavLink
} from "react-router-dom"

class Control extends Component {
    render(){
        return(
            <div>
                <form class="controls">
                    <div>
                        <input type="text" class="textfield" id="search" />
                        <input type="button" name="find" class="searchbutton" value="Find" />
                    </div>
                    <div>
                        <input type="button" name="newPatient" value="New patient" />
                    </div>
                    {/* TODO: dynamic list */}
                    <div class="navpane">
                        <ul>
                            <li class="nav-disabled"><NavLink to="#">«</NavLink></li>
                            <li class="nav-disabled"><NavLink to="#">‹</NavLink></li>
                            <li class="nav"><NavLink to="#">1</NavLink></li>
                            <li class="nav-disabled"><NavLink to="#">›</NavLink></li>
                            <li class="nav-disabled"><NavLink to="#">»</NavLink></li>
                        </ul>
                    </div>
                </form>
            </div>
        )
    }
}

export default Control;
